            const rotateSpeed = 0.03;

            deadpool_mesh.rotation.y += 0.01;
            
            if (keysPressed['w']) {
                deadpool_mesh.position.x -= Math.sin(deadpool_mesh.rotation.y) * moveSpeed;

                deadpool_mesh.position.x += Math.sin(deadpool_mesh.rotation.y) * moveSpeed;
                deadpool_mesh.position.z += Math.cos(deadpool_mesh.rotation.y) * moveSpeed;
            }

            if (keysPressed['w']) deadpool_mesh.position.z -= moveSpeed;
            if (keysPressed['s']) deadpool_mesh.position.z += moveSpeed;
            if (keysPressed['a']) deadpool_mesh.position.x -= moveSpeed;
            if (keysPressed['d']) deadpool_mesh.position.x += moveSpeed;
            if (keysPressed['q']) deadpool_mesh.position.y += moveSpeed;
            if (keysPressed['e']) deadpool_mesh.position.y -= moveSpeed;

            if (keysPressed['ArrowUp']) deadpool_mesh.rotation.x -= rotateSpeed;
            if (keysPressed['ArrowDown']) deadpool_mesh.rotation.x += rotateSpeed;
            if (keysPressed['ArrowLeft']) deadpool_mesh.rotation.y -= rotateSpeed;
            if (keysPressed['ArrowRight']) deadpool_mesh.rotation.y += rotateSpeed;

            if (keysPressed['+']) deadpool_mesh.scale.multiplyScalar(1.01);
            if (keysPressed['-']) deadpool_mesh.scale.multiplyScalar(0.99);

            renderer.render(scene, camera);
            requestAnimationFrame(animate);
        }
        animate(0);
